import React from 'react';

const SeeDoGrowSection = () => {
    return (
        <div className="flex flex-col lg:flex-row items-center justify-center px-6 lg:px-20 py-12 bg-white">
          {/* Left Image */}
          <div className="flex-shrink-0 mb-10 lg:mb-0">
            <div className="w-80 h-80 lg:w-[340px] lg:h-[340px] overflow-hidden rounded-full">
              <img src="/images" alt="Woman holding camera" className="object-cover w-full h-full" />
            </div>
          </div>

          {/* Right Text */}
          <div className="lg:ml-16 text-center lg:text-left max-w-xl">
            <h2 className="text-[#4F6B1C] text-3xl lg:text-4xl font-bold leading-snug mb-2">
              See. Do. Grow.
            </h2>
            <h3 className="text-[#4F6B1C] text-2xl lg:text-3xl font-bold mb-6">
              This is how STOQ works
            </h3>
            <p className="text-[#4F6B1C] text-base lg:text-lg leading-relaxed">
              See everything in one place. Do what matters in an instant—hand off to a teammate, chat on the item, update its status, restock, or move it where it’s needed. Grow efficiency with zero guesswork and nothing but clear, positive results.
            </p>
          </div>
        </div>
      );
    };

export default SeeDoGrowSection;
